import React from 'react';

import AppNavBar from '../AppNavbar/AppNavBar';
import Main from '../MainHome/Main';
import Carrousel from '../CarrouselCities/CarrouselCities';

class Home extends React.Component {
    constructor(props) {
        super(props);
        this.state = {}
    };

    render() {
        return(
            <div>
                {this.props.isLogged}
                <AppNavBar/>
                <Main/>
                <Carrousel/>
            </div>
        )
    }
}
export default Home;
